import React, { Component } from 'react';
import "./posts.css";

export default class Posts extends Component {
    render() {
        return (
            <section id="posts" className="posts">
            <div className="container">
                <div className="blog-img">
                    <img src="assets/img/newspaper-new.jpeg" alt="" />
                </div>
            </div>
            </section>
        )
    }
}
